import '../node_modules/bootstrap/dist/css/bootstrap.css';
import './App.css';
import logo1 from './components/logo1.png';
import logo from './components/logo.png';
import FeatureName from './components/FeatureName';
import Pocket from './components/Pocket';
function App() {
  return (
    <>
    <div className="flex">
      <div className="wrap-input">
<nav>
  <img src={logo1} width="100%"/>
<ul>
  <li><a class="active" href="#"><button className="sign"><b>Sign up</b></button></a></li>
  <li><a href="#"><button className="login"><b>Login</b></button></a></li>

</ul>
</nav>
<h1>
  Game Night
</h1>
<p className="gray">
Order food from favourite restaurants near you.</p>
<div>
<input type="text"></input><button>FIND FOOD</button><p>
POPULAR CITIES IN INDIA<br />
Ahmedabad Bangalore Chennai Delhi Gurgaon Hyderabad Kolkata Mumbai<br/>Pune & more.
</p>
</div>

      </div>
<div className="photo wrap">
<img src={logo} height="95%"/>
</div>

    </div>
   <FeatureName />
   <Pocket />
    </>
  );
}

export default App;
